"use strict";
{
    // Implicit Array
    let friends = ["Rohim", "Korim", "Sabbir"];
    let mixedArray = ["Hello", true, 12];
    console.log(friends, mixedArray);
    // Explicit Array
    let friends2 = ["Rakib", "Sakib", "Akib"];
    let mixedArray2 = ["World", false, 100];
    console.log(friends2, mixedArray2);
}
